import React from 'react';
import abortionInfoImage from '../assets/abortion-info.jpeg';

import './About.css';

function About() {
  return (
    <div className="about-container">
      <h1>About Abortion</h1>
      <img src={abortionInfoImage} alt="Abortion Information" className="about-image" />
      <p>
        Abortion is a medical procedure that ends a pregnancy. Learn more about the causes, 
        reasons, medication, different stages, and effects of abortion.
      </p>
    </div>
  );
}

export default About;
